import React from "react";
import { Link } from "react-router-dom";
import "./css/about.css";

const baseUrl='http://127.0.0.1:8000/api/public';
function ContactUs() {

    return( 
        <div className="container mt-5">
            <div className="bg-info py-1 px-2 mb-2" ><h5>Contact Us</h5></div>
            <div className="row">
                <div className="col-md-3 mb-4">
                    <div className="card w-100">
                        <div className="card-body">
                            <span className="cart-title">Customer Support</span>
                            <p className=" fs-6">support@dicactic.com</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
<img src="/assets/media/img/contact-us/icons/08.svg" class="mb-1" width="65"></img>

export default ContactUs;
